import React, { useState } from "react";

const Navbar10 = () => {
    const [showPopup, setShowPopup] = useState(false);

    const togglePopup = () => {
        setShowPopup(!showPopup);
    }
    return(
        <>
         <div className="text-container">
      <p>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla vel euismod nisl. Donec et ultrices
        velit, vel malesuada lacus. Fusce sit amet nunc ipsum.
      </p>
      <img src="your-image-url.jpg" alt="Image 1" />
      <img src="your-image-url.jpg" alt="Image 2" />

      {showPopup && (
        <div className="popup">
          <p>This is the floating action popup!</p>
          {/* Add content for the popup */}
        </div>
      )}

      <FloatingActionButton onClick={togglePopup} />
    </div>
        </>
    )
}

export default Navbar10;
